class HomePage extends StatefulWidget {
  const HomePage({super.key});

  @override
  State<HomePage> createState() => _HomePageState();
}

class _HomePageState extends State<HomePage> {
  final player = AudioPlayer();
  final base64Audio =
      "";
  List<Posts>? posts;
  String? bytes;
  Tts? tts;
  var isLoaded = false;
  final _textController = TextEditingController();
  String textValue = "";

  @override
  void initState() {
    // TODO: implement initState
    super.initState();
  }

  void setupAudio(String audio) async {
    Uint8List bytess = base64Decode(audio);
    final audioSource = Base64AudioSource(audio, kAudioFormatMP3);
    player.setAudioSource(audioSource);

    try {
      await player.play();
    } on PlayerException catch (e) {
      print('Error playing audio: ${e.message}');
    }
  }

  getBhashini(String value) async {
    tts = await RemoteService().getPosts(value);
    if (tts != null) {
      setupAudio(tts?.pipelineResponse[0].audio[0].audioContent ?? base64Audio);
      setState(() {
        isLoaded = true;
      });
    }
  }

  getData() async {
    // tts = await RemoteService().getPosts();
    // bytes = "data:audio/x-wav;base64,${tts?.pipelineResponse[0].audio[0].audioContent}";
    // await player.play(DeviceFileSource(_filePath)); // will immediately start playing
    print("Posts are $tts");
    // print("Bytes is ${bytes.toString()}");
    // if (bytes != null) {
    //   print("Bytes is yayy ${bytes.toString()}");

    // print("Posts are $posts");
    if (tts != null) {
      print("Posts are again");
      print(tts);
      setState(() {
        // bytes = "data:audio/x-wav;base64,${tts?.pipelineResponse[0].audio[0].audioContent}";
        isLoaded = true;
      });
    }
  }

  @override
  Widget build(BuildContext context) {
    return Scaffold(
      appBar: AppBar(
        title: const Text("Posts"),
      ),
      body: Column(
        children: [
          TextField(
              controller: _textController,
              // Link the controller to the TextField
              decoration: InputDecoration(
                labelText: 'Enter your text to Speak', // Add a label for the input field
              ),
              onChanged: (value) {
                // Update the state whenever the text changes
                setState(() {
                    textValue = value;
                });
              }),
          const Padding(padding: EdgeInsets.all(10)),
          ElevatedButton(
            onPressed: () {
              getBhashini(textValue);
            },
            child: const Text('Play Audio'),
          )
        ],
      ),
    );
  }
}

